import React from 'react';
import Reg from '../pages/Reg';
  
const Navbar = () => {
  return (
    <>
      <Nav>
        <Bars />
  
        <NavMenu>
          <NavLink to='/Reg' activeStyle>
            Regisztracio
          </NavLink>
        </NavMenu>
      </Nav>
    </>
  );
};
  
export default Navbar;
